    /**
     * Description
     * @method loadService
     * @public
     * @param {Object} [params]
     *      @param {String} [params.serviceScriptPath]
     *      @param {String} [params.exchangeScriptPath]
     *      @param {String} [params.serviceUIScriptPath]
     *      @param {String} [params.chatUIScriptPath]
     *      @param {Boolean} [params.loadChatUI]
     *      @param {callback} [params.onLoad]
     */
    TIS.loadService = function (params) {
        var libPath = [];

        if (params.serviceScriptPath) {
            libPath.push(params.serviceScriptPath + "?ver=" + TIS.GAME_VERSION);
        } else if (TIS.MODE === TIS.DEVELOPMODE) {
            libPath = [
                TIS.ROOT_PATH + "/SDK/API/Chat/chatService.js",
                TIS.ROOT_PATH + "/SDK/API/Network/network.js",
                TIS.ROOT_PATH + "/SDK/API/Network/socket.js",
                TIS.ROOT_PATH + "/SDK/API/Database/database.js",
                TIS.ROOT_PATH + "/SDK/API/Util/util.js",
                TIS.ROOT_PATH + "/SDK/API/Log/log.js",
                TIS.ROOT_PATH + "/SDK/API/Share/serviceException.js",
                TIS.ROOT_PATH + "/SDK/API/service.js",
                TIS.ROOT_PATH + "/SDK/API/Lib/IndexedDBShim.js",
                TIS.ROOT_PATH + "/SDK/API/Lib/cryptojs.js",
            ];
        }
        else if (TIS.MINIFI_LOAD) {
            libPath.push("TISService.min.js" + "?ver=" + TIS.GAME_VERSION);
        }else {
            libPath.push("TISService.js" + "?ver=" + TIS.GAME_VERSION);
        }

        if(params.loadChatUI) {
            if (params.chatUIScriptPath) {
                libPath.push(params.chatUIScriptPath + "?ver=" + TIS.GAME_VERSION);
            }  else if (TIS.MODE === TIS.DEVELOPMODE)  {
                libPath.push(TIS.ROOT_PATH + "/ChatUI/chatUI.js");
                libPath.push(TIS.ROOT_PATH + "/ChatUI/chatUtil.js");
            }  else if (TIS.MINIFI_LOAD) {
                    libPath.push("TISChatUI.min.js" + "?ver=" + TIS.GAME_VERSION);
            } else {
                libPath.push("TISChatUI.js" + "?ver=" + TIS.GAME_VERSION);

            }
        }



        if(params && params.loading) {
            TIS._initLoading();
        }

        TIS.Util.loadContent(libPath, {
            onLoad: function () {

                try {
                    var serviceUpdateCode = localStorage.getItem("TIS_SERVICE_CODE"),
                        serviceUpdateVersion = localStorage.getItem("TIS_SERVICE_VERSION");

                    if (serviceUpdateCode &&
                        serviceUpdateVersion &&
                        TIS.Util.compareVersion(serviceUpdateVersion, TIS.Service.VERSION).isGreater) {
                        eval(serviceUpdateCode);
                    }

                    var chatUIUpdateCode = localStorage.getItem("TIS_SERVICE_CHAT_UI_CODE"),
                        chatUIUpdateVersion = localStorage.getItem("TIS_SERVICE_CHAT_UI_VERSION");

                    if (chatUIUpdateCode &&
                        chatUIUpdateVersion &&
                        TIS.Util.compareVersion(chatUIUpdateVersion, TIS.ChatUI.VERSION).isGreater) {
                        eval(chatUIUpdateCode);
                    }

                } catch (e) {
                    console.log("ERROR IN EVAL SERVICE UPDATE");
                }


                if(typeof params.loadServiceUI ===  "boolean" && !params.loadServiceUI) {
                    if (params.onLoad)
                        params.onLoad();

                    return;
                }

                TIS._loadServiceUI(params);

            }
        });
    };

