    /**
     * Description
     * @method showLoading
     */
    TIS.showLoading = function () {

        var elem = document.getElementById("TIS_loading_container");

        if(!elem) {
            TIS._initLoading();

            elem = document.getElementById("TIS_loading_container");
        }
        elem.style.display = "table";

        var msgElm = document.getElementById("TIS_loading_messageContainer");

        if (msgElm) {
            msgElm.innerHTML = "";
        }

    };

    /**
     * Description
     * @method hideLoading
     */
    TIS.hideLoading = function () {
        if (TIS.HAS_MAJOR_CONFLICT) {
            return;
        }
        setTimeout(function () {
            if (TIS.HAS_MAJOR_CONFLICT) {
                return;
            }

            var elem = document.getElementById("TIS_loading_container");
            if (elem && elem.style) {
                elem.remove();
                // document.getElementById("TIS_loading_container").style.display = "none";
            } else {
                TIS.hideLoading();
            }

        }, 500);
    };

